import { useEffect, useState } from 'react';
import axios from 'axios';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { blue } from '@mui/material/colors';

interface Scholarship {
  scholarshipID: number;
  applications: number[];
  awardedApplications: number[];
  awardAmount: number;
  sponsorID: string;
  numberAvailable: number;
  majors: string;
  minors: string;
  gpa: number;
  deadline: string;
  otherRequirements: string;
}

export default function MuiTable({ endpoint }: { endpoint: string }) {
  const [tableData, setTableData] = useState<Scholarship[]>([]);

  useEffect(() => {
    axios.get(endpoint)
      .then(response => {
        const { scholarships } = response.data;
        setTableData(scholarships);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <TableContainer component={Paper} style={{backgroundColor: "#FAFAFA"}}>
      <Table aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell align="center" style={{verticalAlign: "top"}}>Scholarship ID</TableCell>
            <TableCell align="center" style={{verticalAlign: "top"}}>Applications</TableCell>
            <TableCell align="center" style={{verticalAlign: "top"}}>Awarded Applications</TableCell>
            <TableCell align="center" style={{verticalAlign: "top"}}>Award Amount</TableCell>
            <TableCell align="center" style={{verticalAlign: "top"}}>Sponsor ID</TableCell>
            <TableCell align="center" style={{verticalAlign: "top"}}>Number Available</TableCell>
            <TableCell align="center" style={{verticalAlign: "top"}}>Majors</TableCell>
            <TableCell align="center" style={{verticalAlign: "top"}}>Minors</TableCell>
            <TableCell align="center" style={{verticalAlign: "top"}}>GPA</TableCell>
            <TableCell align="center" style={{verticalAlign: "top"}}>Deadline</TableCell>
            <TableCell align="center" style={{verticalAlign: "top"}}>Other Requirements</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {tableData.map((row) => (
            <TableRow key={row.scholarshipID}>
              <TableCell align="center">{row.scholarshipID}</TableCell>
              <TableCell align="center">{row.applications.length}</TableCell>
              <TableCell align="center">{row.awardedApplications.length}</TableCell>
              <TableCell align="center">{row.awardAmount}</TableCell>
              <TableCell align="center">{row.sponsorID}</TableCell>
              <TableCell align="center">{row.numberAvailable}</TableCell>
              <TableCell align="center">{row.majors}</TableCell>
              <TableCell align="center">{row.minors}</TableCell>
              <TableCell align="center">{row.gpa}</TableCell>
              <TableCell align="center">{row.deadline}</TableCell>
              <TableCell align="center">{row.otherRequirements}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
